import React, {Component} from 'react';
import axios from 'axios';

class App extends Component {
  constructor(props){
    super(props);

    this.state = {
      collectionNumber: 0,
      collections: []
    }

  }

  componentDidMount() {
    axios.get('http://localhost:5000/api/collections')
    .then(res => {
      const collections = res.data;
      this.setState({collections})
    })
  }



  render(){
    return(
      <div>
      </div>
    )
  }
}

export default App;
